import React from 'react'
import Navbar from './components/navbar'
import {BrowserRouter as Router} from 'react-router-dom'
import { GlobalStyle } from './GlobalStyle';
import Corpo from './components/Corpo';

function App() {
  return (
    <Router>
      <GlobalStyle/>
     <Navbar/>
     <Corpo/>
    </Router>
  );
}

export default App;
